const AddNewStatusForm = () => (
	<Grid
		xs={12}
		lg={12}
		sm={12}
		md={12}
		item
	>
		<FormControl
			variant={"outlined"}
		>
			<OutlinedInput
				placeholder={"Status name"}
				label={"Status name"}
				name={"name"}
				id={"name"}
				value={""}
			/>
		</FormControl>
	</Grid>
);

export default AddNewStatusForm;
